;; Independence Assumption, Sequential Update for Beta Distribution.
(defquery ind-seq [data]
  (let [a (+ 1 (sample (poisson 1)))		; to make prior similar to uniform distribution.
        b (+ 1 (sample (poisson 1)))]
    (loop [currfreq 0		; current frequency of same vote.
           currtotal 0		; current number of used samples.
           currlist data]	; current list of unused samples.
      (if (empty currlist)
        (sample (beta a b))	; latent for posterior inference.
        (let [nextfreq (+ currfreq (first currlist))	; updated frequency of same vote.
              nexttotal (inc currtotal)					; updated number of used samples.
              nextlist (rest currlist)					; updated list of unused samples.
              prob (/ nextfreq nexttotal)]				; expected prob. for same vote in the next vote.
          (observe (beta a b) prob))))))	; the probability comes from beta distribution.

(def n_sample 5000)
(defn plot-member [i query]
  (let [data (nth encoded-vote i)]
    (print (nth members i))
    (plot/histogram (map :result
                           (take n_sample
                                 (take-nth 10
                                           (drop 1000 (doquery :lmh query [data])))))
                    :bins 30
                    :normalise :probability)))

(for [i (range 0 5)]
  (plot-member i ind-seq))
